Meine realen Kontakte haben mir heute wieder aufgezeigt, wo es hakt und woran ich arbeiten möchte. Vor allem aber, dass ich versuchen will mich zu entspannen. Gelassenheit wieder aktiv zu leben und das zu schätzen was ich habe. Meinen wundervollen Hund zum Beispiel. Und meine tolle Hand voll echte Freunde. Dankbarkeit und Vertrauen sind wohl meine Stichworte. Habt ihr grad auch solche Kernthemen, die euch immer wieder begegnen?

