Im Moment habe ich das Gefühl, dass wir uns hier im Kreis drehen. Läuft etwas nicht gut, reden wir mit unseren Kindern drüber, über unsere Gefühle, besprechen Grenzen und Regeln und meinen, damit sei alles getan.
Und dann werden dieselben Grenzen überschritten. Nicht versehentlich. Nicht irgendwann. Nein, ganz bewusst. Das verärgert einen. Man wird wütend. Will Sachen sagen... Und tut es nicht. Natürlich nicht. Es sind unsere Kinder. Die wir schätzen und lieben, um die wir uns sorgen, für die wir da sein wollen. 
Dennoch gehen wir innerlich auf die Palme, wenn wir immer und immer wieder dasselbe predigen. Ja, Elternsprüche in Endlosschleife. Das können wir mittlerweile sehr gut.
Sind wir stolz darauf? Nein!
Sind wir glücklich darüber? Nein!
Interessiert es irgendjemanden? Offensichtlich nicht!

Also machen wir weiter. Halten durch. Überdenken unsere Grenzen regelmäßig, aber bleiben standhaft, wo es nötig ist. 

